//평가전용 앱 만들기
const {random, floor, ceil, PI} = Math;

class Fund {
	constructor(number, name, endDate, total){
		this.number = number;
		this.name = name;
		this.endDate = endDate;
		this.total = total;
		this.current = 0; //현재 모집금액
	}

	invest(money){
		if(this.current + money > this.total) {
			return {result:false, msg:'투자 금액이 전체 금액을 초과합니다.'};
		}else {
			this.current += money;
			return {result:true, msg:'투자하였습니다. 감사합니다.'};
		}
	}

	drawCanvas(canvas){
		let w = canvas.width = canvas.clientWidth;
		let h = canvas.height = canvas.clientHeight;
		let ctx = canvas.getContext("2d");

		ctx.beginPath();
		ctx.moveTo(w/2, h/2);
		ctx.arc(w/2, h/2, w/2 - 30, -PI/2, 3/2 * PI);
		ctx.fillStyle="rgba(0, 123, 255, 0.3)";
		ctx.fill();
		
		ctx.beginPath();
		ctx.moveTo(w/2, h/2);
		ctx.arc(w/2, h/2, w/2 - 30, -PI/2, -PI/2 + (this.current / this.total) * (2 * PI));
		ctx.closePath();
		ctx.fillStyle="rgba(0, 123, 255, 0.9)";
		ctx.fill();

		ctx.beginPath();
		ctx.moveTo(w/2, h/2);
		ctx.arc(w/2, h/2, w/2 - 50, -PI/2, 3/2 * PI);
		ctx.fillStyle = "rgba(255, 255, 255, 1)";
		ctx.fill();

		let percent = floor(this.current / this.total * 100);
		ctx.fillStyle = "#000";
		ctx.font = '25px Arial';
		ctx.textAlign = "center";
		ctx.textBaseline = "middle";
		ctx.fillText(percent + "%", w/2, h/2);
	}
}

//투자자 클래스
class Investor {
	constructor(fund, name, money, sign){
		this.fund = fund;
		this.name = name;
		this.money = money;
		this.date = new Date();
		this.img = new Image();
		this.img.src = sign;
	}

	download(){
		let canvas = document.createElement("canvas");
		canvas.width = 793;
		canvas.height = 495;
		let ctx = canvas.getContext("2d");
		ctx.drawImage(Investor.bgImg, 0, 0, 793, 495);
		ctx.fillStyle = "#fff";
		ctx.textBaseline = "middle";
		ctx.font="20px Arial";
		ctx.fillText(this.fund.number, 340, 176);
		ctx.fillText(this.fund.name, 340, 217);
		ctx.fillText(this.name, 340, 267);
		ctx.fillText(this.money, 340, 311);
		
		ctx.drawImage(this.img, 470, 390, 300, 80);

		let a = document.createElement("a");
		a.href = canvas.toDataURL("image/jpg");
		a.setAttribute("download", "invest.jpg");
		a.click();
	}
}


class App{
	constructor(){
		this.navList = [].slice.call(document.querySelectorAll(".navigation a")); //NodeList를 Array로 전환
		this.navList.forEach(x => {
			x.addEventListener("click", this.menuClick.bind(this));
		});
		this.sectionList = [].slice.call(document.querySelectorAll("section")); //모든 섹션페이지 가져오기

		//버튼 클릭시 어떤게 로드될지 함수를 설정해둠
		this.lodingFunction = {"list":this.loadingList.bind(this), "register":this.loadingRegister.bind(this), "invest":this.loadingInvest.bind(this)};

		this.fundForm = {
			number:document.querySelector("#fundNo"),
			name:document.querySelector("#fundName"),
			endDate:document.querySelector("#endDate"),
			total:document.querySelector("#total")
		};

		document.querySelector("#register form button").addEventListener("click", this.registerFund.bind(this));

		//투자 팝업
		this.popup = document.querySelector(".popup");
		this.signCanvas = this.popup.querySelector("#sign");
		this.signCanvas.width = this.signCanvas.clientWidth;
		this.signCanvas.height = this.signCanvas.clientHeight;
		this.beforePoint = {x:0, y:0};
		this.signed = false;//싸인했는지 여부를 판단하는 변수
		this.startDraw = false;
		this.signCanvas.addEventListener("mousedown", (e)=>{
			this.startDraw = true;
			this.beforePoint.x = e.offsetX;
			this.beforePoint.y = e.offsetY;
		}); //그리기 시작
		this.signCanvas.addEventListener("mouseup", (e) => {this.startDraw = false}); //그리기 끝
		this.signCanvas.addEventListener("mousemove", this.drawSign.bind(this) ); //그리기
		this.signCtx = this.signCanvas.getContext("2d");
		

		this.popup.querySelector("#btnClose").addEventListener("click", (e) => {
			this.popup.classList.remove("active");
		});
		this.popup.querySelector("#btnInvest").addEventListener("click", this.investTofund.bind(this)); //투자버튼 클릭시

		this.investorList = []; //투자자목록

		this.fundList = [];
		//테스트용으로 펀드 몇개 넣어두기
		// this.fundList.push(new Fund('A013', '스팀게임 구매', '2019-05-07', 40000));
		// this.fundList.push(new Fund('b015', '롯데월드 놀러가기', '2019-05-02', 30000));
		// this.fundList.push(new Fund('Z291', '기말고사 공부 자금', '2019-05-01', 20000)); //지난 펀드
		// this.fundList.push(new Fund('k001', '프로그래밍 학습 자금', '2019-05-15', 75000));
		// this.fundList[0].invest(10000);
		// this.fundList[1].invest(15000);
		// this.fundList[2].invest(5000);
		// this.fundList[3].invest(3000);
		
		//테스트용으로 투자자 몇명 넣어두기
		// this.investorList.push( new Investor(this.fundList[0], "최선한", 2000, "data:image/png;base64,"));
		// this.investorList.push( new Investor(this.fundList[1], "키다리아저씨", 10000, "data:image/png;base64,"));

		this.fundContainer = document.querySelector(".fund-list");
		this.investorContainer = document.querySelector(".investor-list");
		//기본페이지 지정
		this.navList[0].click();
	}

	drawSign(e){
		if(this.startDraw){
			this.strokeStyle = "#000";
			this.signed = true;
			this.signCtx.beginPath();
			this.signCtx.moveTo(this.beforePoint.x, this.beforePoint.y);
			this.signCtx.lineTo(e.offsetX, e.offsetY);
			this.signCtx.stroke();
			this.beforePoint.x = e.offsetX;
			this.beforePoint.y = e.offsetY;
		}
	}

	menuClick(e){
		//해당 메뉴에 activity클래스 추가해주고
		this.navList.forEach(x => x.classList.remove("activity"));
		e.target.classList.add("activity");

		let target = e.target.dataset.target;
		this.sectionList.forEach(x => x.classList.remove("active"));
		document.querySelector(`#${target}`).classList.add("active");
		//지정된 함수를 실행시켜서 해당 페이지를 로딩함.
		this.lodingFunction[target]();
		e.preventDefault();
	}

	loadingRegister(){
		let alpha = floor(random() * 57 + 65);
		if(alpha >= 91 && alpha <= 96){
			alpha += 26;  //특수문자 구간에 걸린경우
		}
		let num = "000" + floor(random() * 999);
		let fundNum = String.fromCharCode(alpha) + num.substring(num.length - 3);

		this.fundForm.number.value = fundNum;
		this.fundForm.name.value = "";
		this.fundForm.endDate.value = "";
		this.fundForm.total.value = "";
	}

	loadingList(){
		this.fundContainer.innerHTML = "";		
		this.fundList.forEach(x => {
			let div = document.createElement("div");
			div.classList.add("fund");
			div.innerHTML = this.getTemplate(x);
			this.fundContainer.appendChild(div);
			let canvas = div.querySelector("canvas");
			x.drawCanvas(canvas);
			div.querySelector("button").addEventListener("click", (e) => {
				this.popupInvest(x);
			});
		});
	}

	popupInvest(fund){
		this.popup.classList.add("active");
		this.popup.querySelector("#invest-no").value = fund.number;
		this.popup.querySelector("#invest-fund").value = fund.name;
		this.popup.querySelector("#invest-name").value = "";
		this.popup.querySelector("#invest-money").value = "";
		this.signCtx.clearRect(0, 0, this.signCanvas.width, this.signCanvas.height);
		this.signed = false; 
	}

	investTofund(){
		let investName = this.popup.querySelector("#invest-name").value;
		let money = this.popup.querySelector("#invest-money").value;
		if(investName == "" || money == "" || isNaN(money) || !this.signed){
			this.showAlert("값이 누락되었거나 적합하지 않습니다.");
			return;
		}
		let num = this.popup.querySelector("#invest-no").value;
		let fund = this.fundList.find(x => x.number == num);
		let result = fund.invest(parseInt(money));
		this.showAlert(result.msg);
		if(result.result){
			this.popup.querySelector("#btnClose").click();
			this.investorList.push( new Investor( fund, investName, money, this.signCanvas.toDataURL() ) );
			this.navList[0].click();
		}
	}

	getTemplate(fund){
		let template = `
			<div class="canvas-container">
				<canvas></canvas>
			</div>
			<div class="info">
				<h4>${fund.number}</h4>
				<p class="name">${fund.name}</p>
				<p class="data-set">
					<span class="end-date">${fund.endDate}</span>
					<span class="totla">${fund.total}원</span>
				</p>
				<div class="button-row">
					<button class="btn btn-blue">투자하기</button>
				</div>
			</div>`;
		return template;
	}

	loadingInvest(){
		this.investorContainer.innerHTML = "";
		for(let i = this.investorList.length -1; i >= 0; i--){
			let x = this.investorList[i];
			
			let div = document.createElement("div");
			div.classList.add("investor");
			div.innerHTML = this.getInvestorTemplate(x);

			this.investorContainer.appendChild(div);
			div.querySelector("button").addEventListener("click", (e)=>{
				x.download();
			});
		}
		
	}

	getInvestorTemplate(investor){
		let template = `<span>${investor.fund.number}</span>
			<span>${investor.fund.name}</span>
			<span>${investor.name}</span>
			<span>${investor.money}원</span>
			<button class="btn btn-blue">투자펀드계약서</button>`;
		return template;
	}

	//펀드 등록버튼 클릭시 실행되는 함수
	registerFund(){
		if( this.fundForm.name.value == "" || this.fundForm.endDate.value == "" || this.fundForm.total == "" ) {
			this.showAlert("누락된 값이 있습니다. 확인하세요");
			return;
		}
		this.fundList.push(new Fund(this.fundForm.number.value, this.fundForm.name.value, this.fundForm.endDate.value, this.fundForm.total.value));
		this.showAlert("등록했습니다.");
		this.navList[0].click(); //펀드 리스트로 이동
	}

	showAlert(msg){
		//이부분을 사용자 친화적인 알람으로 변경하면 더 좋을듯.
		alert(msg);
	}
}


window.onload = function(){
	let app = new App();
}

